B.ZA=new A.a0("Im Hauptmen\xfc siehst du welche Level du bereits freigespielt hast (K\xe4stchen hat eine deckende Farbe (1)). In den oberen K\xe4stchen siehst du einerseits deine aktuelle Anzahl an M\xfcnzen (2) (diese kannst du nutzen um Sonderjellies zu kaufen) und, wie viele XP du hast (3) (diese bestimmen deine Position im Ranking der Highscore-Tafel (4). Die Highscore-Tafel (4) zeigt dir an, wie gut du dich im Vergleich zu anderen Spielern schl\xe4gst. Im Men\xfc (5) kannst du diese Instruktionen jederzeit erneut durchlesen, solltest du etwas vergessen haben. \n                                ",null,null,null,null,null,null,null,null)
B.ZB=new A.a0("Diese t\xe4glichen Belohnungen sind so gestaltet, dass du motiviert wirst, immer wieder zur\xfcckzukehren, um nichts zu verpassen. Je l\xe4nger du spielst, desto gr\xf6\xdfer wird oft die Belohnung. So entsteht der Druck, das Spiel wirklich jeden Tag zu \xf6ffnen, um die maximale Belohnung zu sichern. Genau das ist der Trick dahinter: Dich regelm\xe4\xdfig ins Spiel zu locken, damit du dranbleibst.",null,null,null,null,null,null,null,null)
